    const submit = (e) => {
        e.preventDefault();
    };


    return (
        <>
            <form action="" onSubmit={submit}></form>
            <div className='flex flex-col justify-center items-center min-h-full'>
                <div className='border shadow-lg rounded-lg bg-gray-300'>
                    <div className='m-4 flex flex-col'>
                        <label className='m-2' htmlFor="">Enter Your Name</label>
                        <input className='outline-none border rounded-lg px-4 py-2 shadow' type="text" placeholder='Enter Name' onChange={changeData} name />
