                    </div>
                    <div className='m-4 flex flex-col'>
                        <label className='m-2' htmlFor="">Enter Your Name</label>
                        <input className='outline-none border rounded-lg px-4 py-2 shadow' type="text" placeholder='Enter Phone Number' onChange={changeData} name />
                    </div>
                    <div className='m-4'>
                    <button className='outline-none border rounded-lg px-4 py-2 bg-white shadow'>Click Me</button>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Login
